import {
    style_container as container
} from './index.module.css';

const ExpandableSearch = ({
    placeholder,
    ...props
}) => {
    return <div className={style_container}>
        <input
            type="text"
            {...props}
        />
    </div>
};
export default ExpandableSearch;
